// Header.js
import React from 'react';
import { Link } from 'react-router-dom';
import Logo from "../Assets/Images/logo.png"

const Header = () => {
    return (
        <header className="bg-gradient-to-br from-green-400 via-green-400 to-black">
            <div className="container mx-auto flex items-center justify-between">
            <div className="flex items-center space-x-4">
                <Link to="/">
                    <img src={Logo} alt="logo-site" className="w-20 h-70%" />
                </Link>
            </div>

            <div className="space-y-4">
                    <Link to="/">
                        <div className="acc-1 text-black text-2xl font-bold font-serif break-words">Home</div>
                    </Link>

                    <Link to="/About">
                        <div className="abou-1 text-black text-2xl font-bold font-serif break-words">About Us</div>
                    </Link>

                    <Link to="/Contact">
                        <div className="cont-1 text-black text-2xl font-bold font-serif break-words">Contact Us</div>
                    </Link>

            </div>
            <div className="flex space-x-4">
                <button className="border rounded-full px-4 py-2 hover:bg-green-500 hover:text-black transition duration-300">Login</button>
                <button className="border rounded-full px-4 py-2 hover:bg-yellow-500 hover:text-black transition duration-300">Signup</button>
            </div>
            </div>
        </header>
    );
};

export default Header;
